import React from 'react'
import TaskSummary from "./TaskSummary";
import CreateTask from "./CreateTask";

const TaskList = ({ list }) => {

    const content = list.map( item => {
       return (
           <div key={item.title}>
               <TaskSummary title={item.title}/>
           </div>
       )
    });

    return (
        <div className="section">
            {content}
            <CreateTask />
        </div>
    );
}

export default TaskList
